A function contract specifies the behavior of a function as a predicate that can be checked against the function implementation and also used as an abstraction of the implementation at the call sites. The lifecycle of a contract is split into three phases: specification, verification and call abstraction, which we will explore on this example: fn my_div(dividend: u32, divisor: u32) -> u32 { dividend / divisor
} In the first phase we specify the contract. Kani provides two new annotations: requires (preconditions) to describe the expectations this function has as to the calling context and ensures (postconditions) which approximates function outputs in terms of function inputs. #[kani::requires(divisor != 0)]
#[kani::ensures(|result : &u32| *result <= dividend)]
fn my_div(dividend: u32, divisor: u32) -> u32 { dividend / divisor
} requires here indicates this function expects its divisor input to never be 0, or it will not execute correctly (for instance panic or cause undefined behavior). ensures puts a bound on the output, relative to the dividend input. Conditions in contracts are Rust expressions which reference the function arguments and, in case of ensures, the return value of the function. The return value is passed into the ensures closure statement by reference. Syntactically Kani supports any Rust expression, including function calls, defining types etc. However they must be side-effect free (see also side effects here ) or Kani will throw a compile error. Multiple requires and ensures clauses are allowed on the same function, they are implicitly logically conjoined. Next, Kani ensures that the function implementation respects all the conditions specified in its contract. To perform this check Kani needs a suitable harness to verify the function in. The harness is mainly responsible for providing the function arguments but also set up a valid heap that pointers may refer to and properly initialize static variables. Kani demands of us, as the user, to provide this harness; a limitation of this proposal. See also future possibilities for a discussion about the arising soundness issues and their remedies. Harnesses for checking contract are defined with the proof_for_contract(TARGET) attribute which references TARGET, the function for which the contract is supposed to be checked. #[kani::proof_for_contract(my_div)]
fn my_div_harness() { my_div(kani::any(), kani::any())
} Similar to a verification harness for any other function, we are supposed to create all possible input combinations the function can encounter, then call the function at least once with those abstract inputs. If we forget to call my_div Kani reports an error. Unlike other harnesses we only need to create suitable data structures but we don't need to add any checks as Kani will use the conditions we specified in the contract. Kani inserts preconditions (requires) as kani::assume before the call to my_div, limiting inputs to those the function is actually defined for. It inserts postconditions (ensures) as kani::assert checks after the call to my_div, enforcing the contract. The expanded version of our harness that Kani generates looks roughly like this: #[kani::proof]
fn my_div_harness() { let dividend = kani::any(); let divisor = kani::any(); kani::assume(divisor != 0); // requires let result_kani_internal = my_div(dividend, divisor); kani::assert((|result : &u32| *result <= dividend)(result_kani_internal)); // ensures
} Kani verifies the expanded harness like any other harness, giving the green light for the next step: call abstraction. In the last phase the verified contract is ready for us to use to abstract the function at its call sites. Kani requires that there has to be at least one associated proof_for_contract harness for each abstracted function, otherwise an error is thrown. In addition, by default, it requires all proof_for_contract harnesses to pass verification before attempting verification of any harnesses that use the contract as a stub. A possible harness that uses our my_div contract could be the following: #[kani::proof]
#[kani::stub_verified(my_div)]
fn use_div() { let v = vec![...]; let some_idx = my_div(v.len() - 1, 3); v[some_idx];
} At a call site where the contract is used as an abstraction Kani kani::asserts the preconditions (requires) and produces a nondeterministic value (kani::any) which satisfies the postconditions. Mutable memory is similarly made non-deterministic, discussed later in havocking . An expanded stubbing of my_div looks like this: fn my_div_stub(dividend: u32, divisor: u32) -> u32 { kani::assert(divisor != 0); // pre-condition kani::any_where(|result| { /* post-condition */ result <= dividend })
} Notice that this performs no actual computation for my_div (other than the conditions) which allows us to avoid something potentially costly. Also notice that Kani was able to express both contract checking and abstracting with existing capabilities; the important feature is the enforcement. The checking is, by construction, performed against the same condition that is later used as the abstraction, which ensures soundness (see discussion on lingering threats to soundness in the future section) and guarding against abstractions diverging from their checks.

