Functions can have side effects on data reachable through mutable references or pointers. To overapproximate all such modifications a function could apply to pointed-to data, the verifier "havocs" those regions, essentially replacing their content with non-deterministic values. Let us consider a simple example of a pop method. impl<T> Vec<T> { fn pop(&mut self) -> Option<T> { ... }
} This function can, in theory, modify any memory behind &mut self, so this is what Kani will assume it does by default. It infers the "write set", that is the set of memory locations a function may modify, from the type of the function arguments. As a result, any data pointed to by a mutable reference or pointer is considered part of the write set [3] . In addition, a static analysis of the source code discovers any static mut variables the function or it's dependencies reference and adds all pointed-to data to the write set also. During havocking the verifier replaces all locations in the write set with non-deterministic values. Kani emits a set of automatically generated postconditions which encode the expectations from the Rust type system and assumes them for the havocked locations to ensure they are valid. This encompasses both limits as to what values are acceptable for a given type, such as char or the possible values of an enum discriminator, as well as lifetime constraints. While the inferred write set is sound and enough for successful contract checking [4] in many cases this inference is too coarse grained. In the case of pop every value in this vector will be made non-deterministic. To address this the proposal also adds a modifies and frees clause which limits the scope of havocking. Both clauses represent an assertion that the function will modify only the specified memory regions. Similar to requires/ensures the verifier enforces the assertion in the checking stage to ensure soundness. When the contract is used as an abstraction, the modifies clause is used as the write set to havoc. In our pop example the only modified memory location is the last element and only if the vector was not already empty, which would be specified thusly. impl<T> Vec<T> { #[modifies(if !self.is_empty() => (*self).buf.ptr.pointer.pointer[self.len])] #[modifies(if self.is_empty())] fn pop(&mut self) -> Option<T> { ... }
} The #[modifies(when = CONDITION, targets = { MODIFIES_RANGE, ... })] consists of a CONDITION and zero or more, comma separated MODIFIES_RANGEs which are essentially a place expression. Place expressions describe a position in the abstract program memory. You may think of it as what goes to the left of an assignment. They compose of the name of one function argument (or static variable) and zero or more projections (dereference *, field access .x and slice indexing [1] [5] ). If no when is provided the condition defaults to true, meaning the modifies ranges apply to all invocations of the function. If targets is omitted it defaults to {}, e.g. an empty set of targets meaning under this condition the function modifies no mutable memory. Because place expressions are restricted to using projections only, Kani must break Rusts pub/no-pub encapsulation here [6] . If need be we can reference fields that are usually hidden, without an error from the compiler. In addition to a place expression, a MODIFIES_RANGE can also be terminated with more complex slice expressions as the last projection. This only applies to *mut pointers to arrays. For instance this is needed for Vec::truncate where all of the latter section of the allocation is assigned (dropped). impl<T> Vec<T> { #[modifies(self.buf.ptr.pointer.pointer[len..])] fn truncate(&mut self, len: usize) { ... }
} [..] denotes the entirety of an allocation, [i..], [..j] and [i..j] are ranges of pointer offsets [5] . The slice indices are offsets with sizing T, e.g. in Rust p[i..j] would be equivalent to std::slice::from_raw_parts(p.offset(i), i - j). i must be smaller or equal than j. A #[frees(when = CONDITION, targets = { PLACE, ... })] clause works similarly to modifies but denotes memory that is deallocated. Like modifies it applies only to pointers but unlike modifies it does not admit slice syntax, only place expressions, because the whole allocation has to be freed.

