Kani verifies contracts for recursive functions inductively. Reentry of the function is detected with a function-specific static variable. Upon detecting reentry we use the replacement of the contract instead of the function body. Kani generates an additional wrapper around the function to add the detection. The additional wrapper is there so we can place the modifies contract on check_pop and replace_pop instead of recursion_wrapper which prevents CBMC from triggering its recursion induction as this would skip our replacement checks. #[checked_with = "recursion_wrapper"]
#[replaced_with = "replace_pop"]
fn pop(&mut self) { ... } fn check_pop(&mut self) { ... } fn replace_pop(&mut self) { ... } fn recursion_wrapper(&mut self) { static mut IS_ENTERED: bool = false; if unsafe { IS_ENTERED } { replace_pop(self) } else { unsafe { IS_ENTERED = true; } let result = check_pop(self); unsafe { IS_ENTERED = false; } result };
} Note that this is insufficient to verify all types of recursive functions, as the contract specification language has no support for inductive lemmas (for instance in ACSL section 2.6.3 "inductive predicates"). Inductive lemmas are usually needed for recursive data structures.

