The syntax of existential (i.e., kani::exists) and universal (i.e., kani::forall) quantifiers are: kani::exists(|<var>: <type> [in (<range-expr>)] | <boolean-expression>)
kani::forall(|<var>: <type> [in (<range-expr>)] | <boolean-expression>) If <range-expr> is not provided, we assume <var> can range over all possible values of the given <type> (i.e., syntactic sugar for full range |<var>: <type> as .. |). CBMC's SAT backend only supports bounded quantification under constant lower and upper bounds (for more details, see the documentation for quantifiers in CBMC ). The SMT backend, on the other hand, supports arbitrary Boolean expressions. In any case, <boolean-expression> should not have side effects, as the purpose of quantifiers is to assert a condition over a domain of objects without altering the state. Consider the following example adapted from the documentation for the from_raw_parts function: use std::mem; #[kani::proof]
fn main() { let v = vec![kani::any::<usize>(); 100]; // Prevent running `v`'s destructor so we are in complete control // of the allocation. let mut v = mem::ManuallyDrop::new(v); // Pull out the various important pieces of information about `v` let p = v.as_mut_ptr(); let len = v.len(); let cap = v.capacity(); unsafe { // Overwrite memory for i in 0..len { *p.add(i) += 1; } // Put everything back together into a Vec let rebuilt = Vec::from_raw_parts(p, len, cap); }
} Given the v vector has non-deterministic values, there are potential arithmetic overflows that might happen in the for loop. So we need to constrain all values of the array. We may also want to check all values of rebuilt after the operation. Without quantifiers, we might be tempted to use loops as follows: use std::mem; #[kani::proof]
fn main() { let original_v = vec![kani::any::<usize>(); 100]; let v = original_v.clone(); for i in 0..v.len() { kani::assume(v[i] < 5); } // Prevent running `v`'s destructor so we are in complete control // of the allocation. let mut v = mem::ManuallyDrop::new(v); // Pull out the various important pieces of information about `v` let p = v.as_mut_ptr(); let len = v.len(); let cap = v.capacity(); unsafe { // Overwrite memory for i in 0..len { *p.add(i) += 1; } // Put everything back together into a Vec let rebuilt = Vec::from_raw_parts(p, len, cap); for i in 0..len { assert_eq!(rebuilt[i], original_v[i]+1); } }
} This, however, might unnecessary increase the complexity of the verification process. We can achieve the same effect using quantifiers as shown below. use std::mem; #[kani::proof]
fn main() { let original_v = vec![kani::any::<u32>(); 3]; let v = original_v.clone(); let v_len = v.len(); let v_ptr = v.as_ptr(); let original_v_ptr = original_v.as_ptr(); unsafe { kani::assume( kani::forall!(|i in (0,v_len) | *v_ptr.wrapping_byte_offset(4*i as isize) < 5), ); } // Prevent running `v`'s destructor so we are in complete control // of the allocation. let mut v = mem::ManuallyDrop::new(v); // Pull out the various important pieces of information about `v` let p = v.as_mut_ptr(); let len = v.len(); let cap = v.capacity(); unsafe { // Overwrite memory for i in 0..len { *p.add(i) += 1; if i == 1 { *p.add(i) = 0; } } // Put everything back together into a Vec let rebuilt = Vec::from_raw_parts(p, len, cap); let rebuilt_ptr = v.as_ptr(); assert!( kani::exists!(| i in (0, len) | *rebuilt_ptr.wrapping_byte_offset(4*i as isize) == original_v_ptr.wrapping_byte_offset(4*i as isize) + 1) ); }
} The same principle applies if we want to use the existential quantifier. use std::mem; #[kani::proof]
fn main() { let original_v = vec![kani::any::<u32>(); 3]; let v = original_v.clone(); let v_len = v.len(); let v_ptr = v.as_ptr(); unsafe { kani::assume( kani::forall!(|i in (0,v_len) | *v_ptr.wrapping_byte_offset(4*i as isize) < 5), ); } // Prevent running `v`'s destructor so we are in complete control // of the allocation. let mut v = mem::ManuallyDrop::new(v); // Pull out the various important pieces of information about `v` let p = v.as_mut_ptr(); let len = v.len(); let cap = v.capacity(); unsafe { // Overwrite memory for i in 0..len { *p.add(i) += 1; if i == 1 { *p.add(i) = 0; } } // Put everything back together into a Vec let rebuilt = Vec::from_raw_parts(p, len, cap); let rebuilt_ptr = v.as_ptr(); assert!( kani::exists!(| i in (0, len) | *rebuilt_ptr.wrapping_byte_offset(4*i as isize) == 0) ); }
} The usage of quantifiers should be valid in any part of the Rust code analysed by Kani.

