A loop contract specifies the behavior of a loop as a boolean predicate (loop invariants clauses) with certain frames conditions (loop modifies clauses) that can be checked against the loop implementation, and used to abstract out the loop in the verification process. We illustrate the usage of loop contracts with an example. Consider the following program: fn simple_loop() { let mut x: u64 = kani::any_where(|i| *i >= 1); while x > 1{ x = x - 1; }; assert!(x == 1);
} The loop in the simple_loop function keep subtracting 1 from x until x is 1. However, Kani currently needs to unroll the loop for u64::MAX number of times to verify the assertion at the end of the program. With loop contracts, the user can specify the behavior of the loop as follows: fn simple_loop_with_loop_contracts() { let mut x: u64 = kani::any_where(|i| *i >= 1); #[kani::loop_invariant(x >= 1)] while x > 1{ x = x - 1; }; assert!(x == 1);
} The loop invariant clause #[kani::loop_invariant(x >= 1)] specifies the loop invariants that must hold at the beginning of each iteration of the loop right before checking the loop guard. In this case, Kani verifies that the loop invariant x >= 1 is inductive, i.e., x is always greater than or equal to 1 at each iteration before checking x > 1. Also, once Kani proved that the loop invariant is inductive, it can safely use the loop invariants to abstract the loop out of the verification process. The idea is, instead of exploring all possible branches of the loop, Kani only needs to prove those branches reached from an arbitrary program state that satisfies the loop contracts, after the execution of one iteration of the loop. So, for loops without break statements, we can assume all post-states of the loop satisfying inv && !loop_guard for proving post-loops properties. The requirement of satisfying the negation of the loop guard comes from the fact that a path exits loops without break statements must fail the loop guard. For example, applying loop contracts in simple_loop function is equivalent to the following: fn simple_loop_transformed() { let mut x: u64 = kani::any_where(|i| *i >= 1); x = kani::any(); // Arbitrary program state that kani::assume( !(x > 1) && x >= 1); // satisfies !`guard` && `inv` assert!(x == 1);
} The assumption above is actually equivalent to x == 1, hence the assertion at the end of the program is proved.

