Loop contracts also provide a way to prove the termination of the loop. Without the proof of termination, Kani could report success of some assertions that are actually unreachable due to non-terminating loops. For example, consider the following program: fn simple_loop_non_terminating() { let mut x: u64 = kani::any_where(|i| *i >= 1); #[kani::loop_invariant(x >= 1)] while true{ x = x; }; assert!(x >= 1);
} After abstracting the loop, the loop will be transformed to no-op, and the assertion x >= 1 will be proved. However, the loop is actually an infinite loop, and the assertion will never be reached. For this reason, Kani will also require the user to provide a decreases clause that specifies a decreasing expression to prove the termination of the loop. For example, in fn simple_loop_terminating() { let mut x: u64 = kani::any_where(|i| *i >= 1); #[kani::loop_invariant(x >= 1)] #[kani::loop_decreases(x)] while x > 1{ x = x - 1; }; assert!(x >= 1);
} , the decreases clause #[kani::loop_decreases(x)] specifies that the value of x decreases at each iteration of the loop, and hence the loop will terminate.

