The crate rand is widely used (150M downloads). However, Kani cannot currently handle code that uses it (Kani users have run into this; see Issue 1727 . Consider this example: #[cfg(kani)]
#[kani::proof]
fn random_cannot_be_zero() { assert_ne!(rand::random::<u32>(), 0);
} For unwind values less than 2, Kani encounters an unwinding assertion error (there is a loop used to seed the random number generator); if we set an unwind value of 2, Kani fails to terminate within 5 minutes. Using stubbing, we can specify that the function rand::random should be replaced with a mocked version: #[cfg(kani)]
fn mock_random<T: kani::Arbitrary>() -> T { kani::any()
} #[cfg(kani)]
#[kani::proof]
#[kani::stub(rand::random, mock_random)]
fn random_cannot_be_zero() { assert_ne!(rand::random::<u32>(), 0);
